import Home from './Components/Home';
import Course from './Components/Course';
import AllCourse from './Components/AllCourses';
import AddCourse from './Components/AddCourse';


function App() {
  const btnHandle = () =>{
    toast.success("Done", {
      position:'top-center'
    });
  }
  return (
  <div>
     <ToastContainer />
     <Container>
      <Header></Header>
      <Row>
        <Col md={4}>
          <h2>This is my menu Side</h2>
        </Col>

        <Col md={8}><h2>this is content side</h2></Col>
      </Row>
     </Container>
  </div>
  );
}

export default App;
